#include "../util.h"

class Solution2 {
public:
    long long maxKelements(vector<int>& nums, int k) {
        priority_queue<int> pri(nums.begin(),nums.end());
        long long ans = 0;
        auto ceil = [](int num) {
            if(num % 3 == 0) return num/3;
            else return num/3 + 1;
        };
        for(int i = 0; i < k; ++i) {
            auto num = pri.top();
            ans += num;
            pri.pop();
            pri.emplace(ceil(num));
        }
        return ans;
    }
};

